import React from "react";
import "../../styles/Blog.css";

interface PostState {
  title: string;
  author: string;
  text: string;
}

const Card = (props: PostState) => {
  return (
    <div className="card">
      <div className="card-title">{props.title}</div>
      <div className="card-author">{props.author}</div>
      <div className="card-text">{props.text}</div>
    </div>
  );
};

export default Card;
